INSERT INTO public.trend_reports VALUES ('4676cb6d-aa6f-4510-9c22-35874e81e7f5', 'countrymusic', 'TIKTOK', NULL, NULL, 43, 'stable', '{"hashtags": {"primary": ["countrymusic", "fyp", "country", "music", "viral"], "secondary": ["song", "shorts", "agt", "talent", "aimusic", "foryou"]}, "captionStyle": "Upbeat, enthusiastic, and positive. Use emojis sparingly for emphasis.", "contentThemes": ["Popular Country Artists/Songs", "Family & Heartwarming Content", "Classic Country & Nostalgia", "Bluegrass & Instrumentals", "New/Emerging Artists"], "toneRecommendation": "upbeat, enthusiastic, and positive"}', '{"mood": "engaging", "pace": "fast-paced", "effects": ["color grading", "subtle color grading", "Black and white conversion, rain overlay, film grain, subtle sharpening", "None"], "visualStyle": "modern social media aesthetic, Concert performance recording with a mix of close-ups and wide shots, focusing on the musicians and their instruments., Gritty, melancholic, cinematic, vintage-inspired, Naturalistic, slightly rustic, focusing on the performance aspect.", "promptTemplate": "Create a [Visual Style] video of [A Country Music Band/A Country Musician] performing [Genre, e.g., a soulful ballad/an upbeat anthem] on [Setting]. The lighting should be [Lighting Style, e.g., stage lighting with blue and warm tones/natural daylight]. Use [Camera Movement, e.g., static shots/dynamic camera movements with slow zooms] to capture the [Subject Detail, e.g., lead singer''s emotional performance/musician''s instrumental skills].", "technicalSpecs": {"duration": 9, "aspectRatio": "9:16", "cameraStyle": "dynamic handheld"}}', '{"doNot": ["Use overly complex or lengthy captions.", "Ignore user comments or feedback.", "Focus solely on one subgenre of country music; diversify content to appeal to a wider audience.", "Use excessive or distracting visual effects.", "Post content that is negative, controversial, or offensive."], "summary": "This TikTok content strategy for ''countrymusic'' focuses on creating engaging, upbeat content across a variety of country music subgenres, utilizing modern social media aesthetics with a touch of nostalgia. The strategy emphasizes showcasing both established and emerging artists, leveraging popular hashtags, and maintaining a fast-paced, positive tone to maximize reach and engagement on the platform.", "keyActions": ["Create short, fast-paced videos (around 9 seconds) showcasing popular country songs and artists, utilizing concert performance footage.", "Develop family-friendly and heartwarming content with a positive message, suitable for a broad audience.", "Promote new and emerging country artists by featuring their music and performances, using relevant hashtags to increase discoverability.", "Incorporate classic country and bluegrass elements to appeal to a nostalgic audience, utilizing vintage-inspired visual styles where appropriate.", "Engage with user comments and respond to trends to build a strong community around the ''countrymusic'' hashtag."], "bestPractices": ["Maintain an upbeat, enthusiastic, and positive tone in all content and captions.", "Use emojis sparingly to emphasize points, avoiding overuse.", "Prioritize high-quality audio and video, even when using a gritty or vintage aesthetic.", "Utilize color grading and subtle visual effects to enhance the viewing experience.", "Optimize content for the 9:16 aspect ratio and keep videos concise (around 9 seconds)."]}', '{"Gen Z (18-24)","TikTok active users"}', '{"days": ["Monday", "Wednesday", "Friday", "Saturday"], "times": ["12:00-14:00", "18:00-21:00", "22:00-24:00"], "timezone": "Asia/Seoul"}', 'null', '2025-11-30 12:38:53.687', '2025-11-30 12:38:53.687');
